    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    WMD outlines Refuge accomplishments during the 1967 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and vegetation control. Resource management is
    outlined; topics include grazing and fur harvesting. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    and hunting. Items of interest, N-R forms, photographs, and brochures are attached.",nt"owner_org":
